import React, {useState, useEffect} from 'react';
import Table from 'react-bootstrap/Table';
import UserService from '../user/services/user-services';
import {getProfessionalsResults} from '../user/services/user-services';
import _ from 'lodash';

const Ammattilaiset = () => {
    const[group, setGroup] = useState([]);
    const [results, setResults] = useState([]);
    useEffect (() =>{
        getProfessionalsResults().then(response => setResults(response));
    }, [])

   var t= _.map(_.countBy(results, "date"), (val, key) => ({ date: key, person: val }));
   console.log(t);

    var pResult = _(results) //Ryhmittele tietokannan tiedot päivittäin ja laske treenien määrä päivittäin
            .groupBy(x => x.date)
            .map((value, key) => 
            ({date: key,
            results: _.sumBy(value,'times'),
            nroPeople: _.countBy(value, 'person')['Lilly'],
            users: value})).value();

            var testi=pResult.concat(t);
            console.log(testi);

            var result1 = [
                {id:1, name:'Sandra', type:'user', username:'sandra'},
                {id:2, name:'John', type:'admin', username:'johnny2'},
                {id:3, name:'Peter', type:'user', username:'pete'},
                {id:4, name:'Bobby', type:'user', username:'be_bob'}
            ];
            
            var result2 = [
                {id:2, name:'John', email:'johnny@example.com'},
                {id:4, name:'Bobby', email:'bobby@example.com'}
            ];
            
            var props = ['id', 'name'];
            
            var result3 = result1.filter(function(o1){
                // filter out (!) items in result2
                return !result2.some(function(o2){
                    return o1.id === o2.id;          // assumes unique id
                });
            }).map(function(o){
                // use reduce to make objects with only the required properties
                // and map to apply this to the filtered array as a whole
                return props.reduce(function(newo, name){
                    newo[name] = o[name];
                    return newo;
                }, {});
            });
            console.log(result3);

    var hResult = _(results) //Ryhmittele tietokannan tiedot päivittäin ja laske treenien määrä päivittäin
    .groupBy(x => x.person)
    .map((value, key) => 
    ({person: key,
    results: _.sumBy(value,'times'),
    users1: value})).value();

            console.log(pResult);
            console.log(hResult);

    const professionalsResults = pResult.map((result,index) => 
    <>
    <tr><td>{result.date}</td><td>{result.results}</td>
    <td>{result.person}</td></tr>
    </>
    );
    
    const pResults = (
        <>
        <thead>
        <tr>
        <th>Pvm</th>
        <th>Suoritukset yhteensä</th>
        <th>Suorittajalkm</th>
        </tr>
    </thead>
    <tbody>
        {professionalsResults}
    </tbody>
    </>
    );
    
    return(
        <>
        <h2 style={{textAlign: "center"}}>Ammattilaiset</h2><br />
        <div id="table-div">
            <Table striped bordered hover size="sm">
             {pResults}
            </Table>
        </div>
        </>
    )
}
export default Ammattilaiset;
